import { CommonModule } from '@angular/common';
import {RouterModule, Routes} from "@angular/router";
import {CinemaComponent} from "./cinema/cinema.component";

const routes: Routes=[
  {
    path: 'Cinema',
    component: CinemaComponent
  }
]

@NgModule({
  declarations: [],
  imports: [
    RouterModule.forRoot(routes),
    CommonModule
